import landing from './landing.svg';
import './App.css';
import React from "react";
import Button from "@material-ui/core/Button";
function App() {

  return (
    <div className="Landing-page">
        <h1>Cafe Crystal Method</h1>
        <img src={landing} className="Landing-logo" alt="Company logo"/>
        <h2>Site is under construction...</h2>
        <Button variant="contained">Button</Button>
    </div>

  );
}

export default App;
